import React from 'react';

import { Navbar, Nav, NavItem ,Form,FormControl,Button,Container} from 'react-bootstrap';
import {NavLink} from 'react-router-dom';

class Header extends React.Component {
  render() {
    return (
      <Container>
      <Navbar bg="light" variant="light">
      <Nav className="mr-auto" >

      <NavLink 
                       className="main-anchor" 
                       to="/search">
                       Orders
                   </NavLink>
                   <NavLink 
                       className="main-anchor"    
                       to="/list">
                       Transactions
                   </NavLink>

        <Nav.Link to="/" exact>Home</Nav.Link>
        <Nav.Link to="/search" exact>Features</Nav.Link>
        <Nav.Link to="/list" exact>Pricing</Nav.Link>
      </Nav>
      <Form inline>
        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
        <Button variant="outline-primary">Search</Button>
      </Form>
    </Navbar>
    </Container>
    );
  }
}


export default Header;
